import React from 'react';

const footerContext = React.createContext({
  front: [
  {
    id: 1, title: 'Développeur Front-End', content: [
      { id: 1, name: 'HTML' },
      { id: 2, name: 'CSS' },
      { id: 3, name: 'Javascript' },
      { id: 4, name: 'React' },
    ]
  }
],
  back: [
  {
    id: 1, title: 'Développeur Back-End', links: [
      { id: 5, name: 'Ruby' },
      { id: 6, name: 'Rails' },
      { id: 7, name: 'SQL' },
      { id: 8, name: 'MongoDB' },
    ]
  }
],
  marketing: [
  {
    id: 1, title: 'Marketing Digital', links: [
      { id: 1, name: 'SEO' },
      { id: 2, name: 'SEA' },
      { id: 3, name: 'Email Marketing' },
      { id: 3, name: 'Marketing de contenu' },
    ]
  }
],
});

export default footerContext
